import React from "react";

const ImageDisplay = (props) => {
  return (
    <div className="imageDisplay center mt5">
      {props?.url?.length > 0 ? (
        <img src={props.url} alt="Invalid image" className="f3 dark-red b" />
      ) : null}
      {props?.concepts?.length > 0 ? (
        <div className="w-30">
          <p className="f2 u">Results :</p>
          <ul className="white">
            {props.concepts.map((x) => (
              <li>{x.name + " : " + parseInt(x.value * 100) + "%"}</li>
            ))}
          </ul>
        </div>
      ) : null}
    </div>
  );
};
export default ImageDisplay;
